INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "フリーマーケット会場", 7, 2834, 91002, 8, 20063115, 5118061, "ペコリーヌとの出会い", "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "フリーマーケット会場", 7, 2835, 91002, 8, 20063115, 5118062, "マホとの出会い", "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "ランドソル市街地", 7, 2837, 91002, 8, 20063115, 5118063, "アキノとの出会い", "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "フリーマーケット会場", 18, 4108402, 91002, 8, 20063115, 5118064, "ジュンとの出会い", "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 2, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "フリーマーケット会場", 18, 4107402, 91002, 8, 20063115, 5118065, "カオリとの出会い", "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 2, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 1, 10118, "オーエド町", 16, 9000227, 91002, 8, 20063115, 5118066, "ニノンとの出会い", "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 2, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "フリーマーケット会場", 19, 2101181, 91002, 8, 20063115, 5118067, "スズナとの出会い", "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 3, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "ランドソル市街地", 18, 4109402, 91002, 8, 20063115, 5118068, "ナナカとの出会い", "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 3, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "フリーマーケット会場", 18, 4305402, 91002, 8, 20063115, 5118069, "キャル＆コッコロとの出会い", "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 3, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "ランドソル市街地", 18, 4101402, 91002, 8, 20063115, 5118070, "ユカリとの出会い", "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 3, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 0, 10118, "ランドソル市街地", 18, 4106402, 91002, 8, 20063115, 5118071, "アオイとの出会い", "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 3, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (1, 1, 10118, "フリーマーケット会場", 7, 2836, 91002, 8, 20063115, 5118072, "シノブとの出会い", "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 3, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (0, 0, 10118, 0, 0, 0, 0, 0, 20063115, 5118600, "オープニング", "彼女たちの新たな日常", 0, 1, 0);
